function CostForm() {

   const nemeChangeHandler = (event) => {
      console.log('fff');
   }

  return (
    <form>
      <div className="new-cost__controls">
        <div className="new-cost__control">
          <label>Название</label>
          <input type="text" onChange={nemeChangeHandler}/>
        </div>

        <div className="new-cost__control">
          <label>Сумма</label>
          <input type="text" min="0.01" step="0.01" />
        </div>

        <div className="new-cost__control">
          <label>Дата</label>
          <input type="date" />
        </div>
      </div>
    </form>
  );
}

export default CostForm;
